INSERT INTO `faq` (`id`, `question`, `answer`, `created_at`, `updated_at`) VALUES
(16, 'What is the 340B Drug Pricing Program?', 'The 340B Drug Pricing Program is a Federal program that began in 1992 and requires drug manufacturers (Pharmaceutical Companies) to discount medications for patients that receive healthcare services at facilities such as yours. These discounts do not impact tax payer dollars and directly help patients and healthcare facilities improve patient care.', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(17, 'Who is eligible for savings?', 'The primary requirement is that the patient receives healthcare services from an eligible facility such as yours. They amount of savings and who benefits will differ depending on if the patient has prescription coverage as well as the type of coverage.', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(18, 'How much are the savings?', 'Average savings are between 25- 50%, but the exact amount will differ based on the individual prescription and type of coverage.', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(19, 'How can I help my patients and Health Care Facility benefit from the available savings?', 'Work with your patients to help them identify a convenient Partner Pharmacy to fill their prescriptions*', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(20, 'What is a Partner Pharmacy?', 'Your Health Care facility has contracted with local pharmacies in your community called Partner Pharmacies to sell the 340B discounted medications to patients of your Health Care Facility.', '0000-00-00 00:00:00', '0000-00-00 00:00:00');
