INSERT INTO `quotes` (`id`, `content`, `author`, `last_used`, `status`) VALUES
(1, 'With the new day comes new strength and new thoughts.', 'Eleanor Roosevelt', '2018-04-09', 0),
(2, 'In order to succeed, we must first believe that we can.', 'Nikos Kazantzakis', '2018-03-05', 0),
(3, 'Optimism is the faith that leads to achievement. Nothing can be done without hope and confidence.', 'Helen Keller', '2018-04-02', 0),
(4, 'Failure will never overtake me if my determination to succeed is strong enough.', 'Og Mandino', '2018-03-19', 0),
(5, 'It always seems impossible until it\'s done.', 'Nelson Mandela', '2018-03-12', 0),
(6, 'Quality is not an act, it is a habit', 'Aristotle', '2018-03-26', 0),
(7, 'Keep your eyes on the stars, and your feet on the ground', 'Theodore Roosevelt', '2018-04-16', 0),
(8, 'Always do your best. What you plant now, you will harvest later.', 'Og Mandino', '2018-04-23', 0),
(9, 'Believe in yourself! Have faith in your abilities! Without a humble but reasonable confidence in your own powers you cannot be successful or happy.', 'Norman Vincent Peale', '2018-09-29', 0),
(10, 'If you can dream it, you can do it.', 'Walt Disney', '2018-10-02', 0),
(11, 'You can\'t cross the sea merely by standing and staring at the water.', 'Rabindranath Tagore', '2018-10-10', 0),
(12, 'It does not matter how slowly you go as long as you do not stop.', 'Confucius', '2018-10-15', 1),
(13, 'What you do today can improve all your tomorrows.', 'Ralph Marston', '2017-10-30', 0),
(14, 'The secret of getting ahead is getting started.', 'Mark Twain', '2017-11-06', 0),
(15, 'Accept the challenges so that you can feel the exhilaration of victory.', 'George S. Patton', '2017-11-14', 0),
(16, 'Problems are not stop signs, they are guidelines.', 'Robert H. Schuller', '2017-11-20', 0),
(17, 'The will to win, the desire to succeed, the urge to reach your full potential... these are the keys that will\r\n\r\nunlock the door to personal excellence.', 'Confucius', '2017-11-27', 0),
(18, 'Setting goals is the first step in turning the invisible into the visible.', 'Tony Robbins', '2017-12-04', 0),
(19, 'Our greatest weakness lies in giving up. The most certain way to succeed is always to try just one more time.', 'Thomas A. Edison', '2017-12-11', 0),
(20, 'Wherever you are - be all there.', 'Jim Elliot', '2017-12-18', 0),
(21, 'Ever tried. Ever failed. No matter. Try Again. Fail again. Fail better.', 'Samuel Beckett', '2017-12-26', 0),
(22, 'Be kind whenever possible. It is always possible.', 'Dalai Lama', '2018-01-02', 0),
(23, 'We may encounter many defeats but we must not be defeated.', 'Maya Angelou', '2018-01-08', 0),
(24, 'You are never too old to set another goal or to dream a new dream.', 'Les Brown', '2018-01-15', 0),
(25, 'Aim for the moon. If you miss, you may hit a star.', 'W. Clement Stone', '2018-01-22', 0),
(26, 'Things do not happen. Things are made to happen.', 'John F. Kennedy', '2018-01-29', 0),
(27, 'It\'s always too early to quit.', 'Norman Vincent Peale', '2018-02-05', 0),
(28, 'I know where I\'m going and I know the truth, and I don\'t have to be what you want me to be. I\'m free to be what I want.', 'Muhammad Ali', '2018-02-12', 0),
(29, 'You can never quit. Winners never quit, and quitters never win.', 'Ted Turner', '2018-02-19', 0),
(30, 'If you don&#39;t design your own life plan, chances are you&#39;ll fall into someone else&#39;s plan. And guess what they have planned for you? Not much.', 'Jim Rohn', '2018-02-26', 0);
